import React, {Component, Fragment} from "react";
import "./DetailPost.css";

class DetailPost extends Component{
    render(){
        return(
            <Fragment>
              <p>Detail Post</p>
              <hr/>
            </Fragment>
        );
    }
}

export default DetailPost;
